Slovakia.meta:
The Slovak language, similar in appearance to Czech for non-speakers, has distinct letters unique to it:

Slovak includes Ľ, Ô, Ä, Ŕ, and Ĺ;
Czech, on the other hand, uses Ř, Ě, and Ů.

